   return new Promise((resolve, reject) => {
        HttpClient.post('/RequestDocument/SaveRequestDocument' , model).then(response => {
            resolve(response);
        }).catch(error => {
            resolve(error.response);
        })
    }) 
}

export const GetRequestsDocumentById =(id)=> {
